INSERT INTO `email_template` (`id`, `subject`, `body`, `type`, `created_at`, `updated_at`) VALUES
(2, 'New Payout Request', '<p>Hi {{site_name}} Administrator,<br />You are required to review withdrawal request of {{amount}} with a charge of {{charge}} for {{first_name}} {{last_name}}.</p>', 'new_withdraw_request_admin', '2021-06-29 14:41:27', '2023-07-14 00:16:17'),
(3, 'Payout Request Approved', '<p>Hi {{first_name}},<br />Payout request {{reference}} of {{amount}} has been approved.<br />Thanks for working with us</p>', 'withdraw_request_approve', '2021-08-05 12:21:50', '2023-07-14 00:16:44'),
(4, 'Payout Request Declined', '<p>Hi {{username}},<br />Payout request {{reference}} of {{amount}} has been declined. {{reason}}<br />Thanks for working with us</p>', 'withdraw_request_decline', '2021-08-05 12:21:40', '2023-07-14 00:18:07'),
(5, 'Deposit Request Approved', '<p>Hi {{first_name}},<br />Deposit request #{{reference}} of {{amount}} has been approved.<br />Thanks for working with us</p>', 'deposit_request_approve', '2021-08-05 12:53:38', '2023-07-14 00:18:21'),
(6, 'Deposit Request Declined', '<p>Hi {{first_name}},<br />Deposit request #{{reference}} of {{amount}} has been declined. {{reason}}<br />Thanks for working with us</p>', 'deposit_request_decline', '2021-08-05 12:53:32', '2023-07-14 00:18:55'),
(7, 'Welcome to Bespoke', '<p>We are thrilled to extend a warm welcome to you as a valued member of Kingsmen Investment Software! Thank you for choosing our platform to assist you on your journey to financial success.</p>\r\n<p>At Kingsmen, we understand the importance of making sound investment decisions, and we are committed to providing you with a powerful and user-friendly software that will empower you to navigate the complex world of investments with confidence and ease.</p>\r\n<p>What sets Kingsmen apart:</p>\r\n<ol>\r\n<li>\r\n<p>Cutting-edge Technology: Our software utilizes the latest advancements in artificial intelligence and data analytics to deliver real-time market insights and personalized investment strategies.</p>\r\n</li>\r\n<li>\r\n<p>Comprehensive Market Analysis: Access a wealth of financial data, historical trends, and expert analysis to stay informed and make informed investment decisions.</p>\r\n</li>\r\n<li>\r\n<p>User-Friendly Interface: We have designed Kingsmen with you in mind, ensuring an intuitive and seamless user experience for both novice and experienced investors.</p>\r\n</li>\r\n<li>\r\n<p>Personalized Portfolio Management: Tailor your investment portfolio according to your financial goals and risk appetite, with our sophisticated portfolio management tools.</p>\r\n</li>\r\n<li>\r\n<p>Dedicated Customer Support: Our support team is ready to assist you with any inquiries or concerns you may have. We are committed to providing prompt and reliable support to ensure your satisfaction.</p>\r\n</li>\r\n</ol>\r\n<p>To get started with Kingsmen, simply log in to your account using the credentials you provided during registration. Once logged in, take advantage of our comprehensive tutorials and guides to explore the full potential of our software.</p>\r\n<p>Should you require any assistance or have any questions about Kingsmen\'s features, don\'t hesitate to reach out to our customer support team.&nbsp;We are always here to help!</p>\r\n<p>Thank you again for choosing Kingsmen Investment Software. We are confident that our platform will be an indispensable tool in your financial journey, and we look forward to witnessing your investment success!</p>\r\n<p>Happy investing!</p>\r\n<p>Sincerely,</p>\r\n<p>Kingsmen Investment Software Team</p>', 'welcome_message', '2022-04-26 16:30:46', '2023-07-25 11:34:56'),
(8, 'Compliance approved', '<p>We hope this email finds you in good health and high spirits. We are delighted to inform you that your Know Your Customer (KYC) verification process has been successfully completed, and we are thrilled to welcome you onboard as a valued member of Kingsmen Investment Software!</p>\r\n<p>Completing the KYC process is a crucial step in ensuring the security and authenticity of our platform. Your cooperation and promptness during the verification process are greatly appreciated.</p>\r\n<p>With your KYC approval, you now have unrestricted access to all the powerful features and functionalities of Kingsmen. As you embark on your investment journey with us, we assure you of a seamless and secure experience, backed by cutting-edge technology and unparalleled support.</p>\r\n<p>Here are some key highlights of what you can expect from Kingsmen:</p>\r\n<ol>\r\n<li>\r\n<p>Investment Insights: Gain access to real-time market insights, trends, and analysis, enabling you to make informed and data-driven investment decisions.</p>\r\n</li>\r\n<li>\r\n<p>Personalized Portfolio Management: Customize your investment portfolio to align with your financial goals and risk tolerance, while leveraging our sophisticated portfolio management tools.</p>\r\n</li>\r\n<li>\r\n<p>Continuous Support: Our dedicated customer support team is always ready to assist you with any questions or concerns you may have.</p>\r\n</li>\r\n</ol>\r\n<p>To get started, log in to your Kingsmen account using the credentials you provided during registration. In case you have any trouble accessing your account, please let us know, and we will be happy to assist you promptly.</p>\r\n<p>We are confident that Kingsmen Investment Software will be your trusted companion in achieving your financial aspirations. Our platform is designed to empower you with the tools and information needed to make well-informed investment decisions.</p>\r\n<p>Thank you once again for choosing Kingsmen as your investment partner. We are excited to have you as part of our community, and we look forward to witnessing your investment success.</p>\r\n<p>Should you have any further queries or need assistance with anything, please do not hesitate to get in touch. We are here to help you make the most of your Kingsmen experience.</p>', 'compliance_approval', '2022-04-26 16:30:46', '2023-07-25 11:36:56'),
(9, 'Resubmit Kyc', '<div>\r\n<div>Thank you for submitting your KYC (Know your Customer) documents. After a careful review, we regret to inform you that your documentation is incomplete and cannot be approved at this time because of suspicious behaviour: {{reason}}. Please be advised that your account is inactive and you will not be able to accept payments. The safety and legitimacy of our Merchants and their customers are of utmost importance to us at {{site_name}}. Please log in to your account to re-submit valid documents to reactivate your account.</div>\r\n<div>&nbsp;</div>\r\n<div>If you have any questions, feel free to reach out to us. Best Regards, The {{site_name}} Team!</div>\r\n</div>', 'compliance_resubmit', '2022-04-26 16:30:46', '2022-04-26 16:30:46'),
(10, 'Purchased Unit', '<div style=\"text-align: center;\">\r\n<p>Hi {{first_name}},</p>\r\n<p>Your unit purchase was successful&nbsp;</p>\r\n<p>Here are the details:</p>\r\n<div>&nbsp;</div>\r\n</div>', 'unit_purchase', '2022-04-26 16:30:46', '2022-04-26 16:30:46'),
(11, 'Investment Returns', '<div style=\"text-align: center;\">\r\n<p>Hi {{first_name}},</p>\r\n<p>Your account has been credited with investment returns;</p>\r\n<p>Here are the details:</p>\r\n<div>&nbsp;</div>\r\n</div>', 'investment_returns', '2022-04-26 16:30:46', '2022-04-26 16:30:46'),
(12, 'Unit Sale', '<div style=\"text-align: center;\">\r\n<p>Hi {{first_name}},</p>\r\n<p>Your unit sale was successful&nbsp;</p>\r\n<p>Here are the details:</p>\r\n<div>&nbsp;</div>\r\n</div>', 'unit_sale', '2022-04-26 16:30:46', '2022-04-26 16:30:46'),
(13, 'Transaction Successful', '<div style=\"text-align: center;\">\r\n<p>Transaction was successful&nbsp;</p>\r\n<p>Here are the details:</p>\r\n<div>&nbsp;</div>\r\n</div>', 'transfer_debit', '2022-04-26 16:30:46', '2022-04-26 16:30:46'),
(14, 'Transaction Successful', '<div style=\"text-align: center;\">\r\n<p>Transaction was successful&nbsp;</p>\r\n<p>Here are the details:</p>\r\n<div>&nbsp;</div>\r\n</div>', 'transfer_credit', '2022-04-26 16:30:46', '2022-04-26 16:30:46'),
(15, 'Loan Approved', '<div style=\"text-align: center;\">\r\n<p>Loan approved and paid out to your account&nbsp;</p>\r\n</div>', 'loan_approved', '2022-04-26 16:30:46', '2022-04-26 16:30:46'),
(16, 'Loan Declined', '<div style=\"text-align: center;\">\r\n<p>Loan declined, reason {{reason}}&nbsp;</p>\r\n</div>', 'loan_declined', '2022-04-26 16:30:46', '2022-04-26 16:30:46'),
(17, 'Loan Paid', '<div style=\"text-align: center;\">\r\n<p>Transaction was successful&nbsp;</p>\r\n<p>Here are the details:</p>\r\n<div>&nbsp;</div>\r\n</div>', 'loan_payment', '2022-04-26 16:30:46', '2022-04-26 16:30:46'),
(18, 'Savings Deposit', '<div style=\"text-align: center;\">\r\n<p>Transaction was successful&nbsp;</p>\r\n<p>Here are the details:</p>\r\n<div>&nbsp;</div>\r\n</div>', 'savings_deposit', '2022-04-26 16:30:46', '2022-04-26 16:30:46'),
(19, 'Savings Return', '<div style=\"text-align: center;\">\r\n<p>Transaction was successful&nbsp;</p>\r\n<p>Here are the details:</p>\r\n<div>&nbsp;</div>\r\n</div>', 'savings_return', '2022-04-26 16:30:46', '2022-04-26 16:30:46'),
(20, 'Savings Withdraw', '<div style=\"text-align: center;\">\r\n<p>Transaction was successful&nbsp;</p>\r\n<p>Here are the details:</p>\r\n<div>&nbsp;</div>\r\n</div>', 'savings_withdraw', '2022-04-26 16:30:46', '2022-04-26 16:30:46'),
(21, 'Dividend Return', '<div style=\"text-align: center;\">\n<p>Transaction was successful&nbsp;</p>\n<p>Here are the details:</p>\n<div>&nbsp;</div>\n</div>', 'dividend_return', '2022-04-26 16:30:46', '2022-04-26 16:30:46');
