INSERT INTO `loan_plans` (`id`, `name`, `slug`, `duration`, `status`, `installment`, `interest`, `failed_interest`, `min`, `max`, `suggested_amount`, `type`, `image`, `amount`, `description`, `cat_id`, `product_type`, `digital_link`, `created_by`, `edited_by`, `created_at`, `updated_at`, `deleted_at`) VALUES
('21a96194-ea21-4e0d-8133-91aaa2213be5', 'Student - Installment', 'student-installment', 3, 1, 1, 10, 15, 10000, 50000, '[{\"value\":\"10000\"},{\"value\":\"15000\"},{\"value\":\"20000\"},{\"value\":\"35000\"}]', 'loan', NULL, NULL, NULL, NULL, NULL, NULL, '21ecb553-6d87-44a7-9665-87dcec166315', '21ecb553-6d87-44a7-9665-87dcec166315', '2023-08-09 17:04:40', '2023-08-13 20:03:40', NULL),
('82d59356-5ba0-41db-997e-f922177c8af2', 'Student', 'student', 2, 1, 0, 10, 15, 10000, 50000, '[{\"value\":\"10000\"},{\"value\":\"15000\"},{\"value\":\"20000\"},{\"value\":\"35000\"},{\"value\":\"40000\"}]', 'loan', NULL, NULL, NULL, NULL, NULL, NULL, '21ecb553-6d87-44a7-9665-87dcec166315', '21ecb553-6d87-44a7-9665-87dcec166315', '2023-08-09 17:02:32', '2023-08-13 20:03:19', NULL),
('bb10656d-bba3-4f76-977d-c1c0dde74a0d', 'Iphone 14pro max', 'iphone-14pro-max', 10, 1, 1, 10, 12, NULL, NULL, NULL, 'product', 'product/yAAicj5Rnqudz3kBVKiArknEbLwMNLeEq2LacNig.jpg', 1199, 'The best iPhone ever, version 2022, size XL - we have the iPhone 14 Pro. The list of novelties this year includes the notch morphing into a pill, the introduction of an Always-On display, and an all-new primary camera - and while you can get all of that on the 14 Pro, the extra screen estate and longevity coupled with the Max\'s \'ultimate\' status mean it has a market niche of its own.\nThe Face ID notch that\'s been with us since the iPhone X was nobody\'s favorite, and perhaps its reincarnation as a pill is a step towards its eventual removal. But not before turning the eyesore into a feature - the pill is a Dynamic Island of notifications, blurring the line between hardware and software.\nIn a similar vein is the Always-On display - a software feature only made possible now in Apple\'s world thanks to LTPO displays being able to ramp down to 1Hz refresh rate.\nA massive increase in brightness is also among the key developments this year, this one solely in the hardware department.\nLate to yet another party, Apple finally joins virtually every other manufacturer and introduces a camera with a Quad Bayer type sensor - the specs on the 48MP main unit don\'t read like any other, so apparently, it\'s an exclusive design. The telephoto remains unchanged, but the ultra-wide has gotten a sensor size upgrade, while the front-facing one now features autofocus (and even OIS).\nOn the hardware front, there\'s the mandatory chipset update, of course, and little else worth mentioning. Well, there\'s the blanked-out SIM card slot. Crash detection and emergency sort-of satellite connectivity are also on the list of new features combining software and hardware.\niPhone 14 Pro and iPhone 14 Pro do not include a power adapter or Ear Pods. Included in the box is a USBC to Lightning Cable that supports fast charging and is compatible with USBC power adapters and computer ports.\n\nWe encourage you to reuse your current USBA to lightning cables, power adapters and headphones that are compatible with these iPhone models. But if you need any new Apple power adapters or headphones, they are available for purchase.', '96276e98-d948-4618-940e-14e706b153f9', 'digital', 'https://google.com', '21ecb553-6d87-44a7-9665-87dcec166315', '21ecb553-6d87-44a7-9665-87dcec166315', '2023-08-14 14:28:43', '2023-08-15 09:15:42', NULL),
('df7b4265-1797-48b9-b848-e0a3ff0ee321', 'Samsung S23 Ultra', 'samsung-s23-ultra', 18, 1, 1, 10, 13, NULL, NULL, NULL, 'product', 'product/S9HubHj8eBkmIc7hq1M0kMrdotHcN9SEhB6XeCoh.jpg', 883, 'Galaxy S23 Ultra Dual SIM - 12GB RAM - 256GB - 5G\n\nFeaturesCapture the night, even in low lightReady to own the night? Whether youre headed to a concert or a romantic night out, theres no such thing as bad lighting with Night Mode. Galaxy S23 Ultra lets you capture epic content in any setting with stunning Nightography.\nCapture scenes in stunning detail\n\nCreate crystal-clear content worth sharing with the Galaxy S23 Ultra 200MP camera. Whether youre posting or printing, Galaxy S23 Ultra always does the moment justice.\nSteady video. Incredibly easy.\n\nCapture incredibly smooth video during lifes most exciting moments. With Video Stabilization, you can easily record daytime outdoor adventures or those spur-of-the-moment dance parties at night.\nUpgrade your Note pad\n\nCapture scribbles, strokes of genius, and everything in between with the built-in S Pen. Writing your next short story or sketching on the go has never felt this easy.\n', '96276e98-d948-4618-940e-14e706b153f9', 'physical', NULL, '21ecb553-6d87-44a7-9665-87dcec166315', '21ecb553-6d87-44a7-9665-87dcec166315', '2023-08-14 14:43:16', '2023-08-14 14:44:01', NULL);
