('294777fc-88c8-4d77-8b76-b7b64c8a44fb', 'Afrinvest Plutus Fund', 'afrinvest-plutus-fund', 'The Afrinvest Plutus Fund enables all categories of income earners to invest in low-risk, short-term, highly liquid securities such as treasury bills and commercial papers.', NULL, NULL, NULL, NULL, 'Month', NULL, NULL, NULL, 1, NULL, 'invest/IgcO4GWzeVas7inoPbNPS9vyz1t6uIPBYvwHVHFf.png', 'mutual', NULL, NULL, 'percent', NULL, '1', NULL, NULL, 'The Fund is aimed at investors who seek safety and preservation of capital as well as attractive real returns.', 'The returns are based on daily changes in the price of the stocks. However, there can be losses.', 'This fund is provided by Afrinvest (West Africa) Limited. However, all transactions are aggregated by Kingsmen. As such, you can only redeem purchased units of this mutual fund directly through Kingsmen.', 'Meristem Trustees', 'Castro Group', NULL, 1, 10, 1, 10, 10, 1, 1, 1, '21ecb553-6d87-44a7-9665-87dcec166315', '21ecb553-6d87-44a7-9665-87dcec166315', '2023-07-30 14:08:06', '2023-08-27 15:16:20', NULL),
('30eb34a5-f0e9-43e6-aa7f-5a9107f78a21', 'DNA Farms', 'dna-farms', 'Psaltry International Company Limited (PIL) [https://psaltryinternational.com] is an agro-allied company founded by Oluyemisi Iranloye in the year 2005. The company started out by creating a market niche for cassava produce across the rural areas of Oyo State Nigeria. PIL initiated an out-grower program in September 2012 for farmers within an 80km radius of its factory before erecting a starch factory which commenced production in May 2013.\n\nPsaltry has over 8000 hectares of land suited for out-grower programs, and has employed more than 300 staff with an asset worth of 15 million USD. Our modus operandi is eco-friendly; We installed a water recycling system to detoxify recalcitrant substances before disposing them into the environment and reduces amount of water usage in our production process.\n\nCassava farming is a source of livelihood for millions of farmers. Also, cassava serves as a primary staple food to over 800 million people worldwide. It is the third-largest source of food carbohydrates in the tropics, after rice and maize. Cassava is used for producing food products like garri, flour, tapioca, fufu, chips, e.t.c. It is rich in vitamins, carbs, calcium, etc. Nigeria is the worlds largest producer of cassava, while Thailand is the largest exporter of cassava with most of it going to Europe. In 2017, Nigeria produced 59 million tons making about 20% of global world production. Besides, it exports about 3.2 million tons annually and earned $136 million in 2013.', '2023-07-23 23:00:00', '2023-12-23 23:00:00', '2025-01-24', '18', 'Month', '39991', 40000, '1000', 1, 15, 'invest/JMp5BJ7GrYKc7Mjwy6d48Y1Xn9EqFCjNlgi7Sipq.jpg', 'project', '840c467b-07bc-4fd7-87e7-830243fadd4f', NULL, 'percent', NULL, '1', 'Ajah, Lagos', 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, NULL, NULL, NULL, 0, 0, '21ecb553-6d87-44a7-9665-87dcec166315', '21ecb553-6d87-44a7-9665-87dcec166315', '2023-07-23 22:54:32', '2023-07-25 08:25:57', NULL),
('310956db-1dce-4e3a-a30d-47a39e7d40f2', 'Minoas Sea Villa', 'minoas-sea-villa', 'Nuzzled in a gorgeous setting, above the sun kissed beach of Georgioupolis in Crete, Minoas Villas captures the essence of chic and luxurious living only few minutes away from the shimmering sea. Built amphitheatrically with direct sea views, this exceptional built Villas, member of the HotelPraxis Group evokes the islands Cretan spirit and cosmopolitan charm in its elegant environs while ensuring a holiday beyond comparison.\nThe space\nFacilities of the Villa.\nGround floor\n A large living-dining room with sofas (can accommodate two guests) with direct access to the terrace.\n Kitchen with an oven, a fridge, dishwasher, a coffee maker, tea facilities, a juicer, a toaster, a dish set and dining area.\n A master bedroom with a queen-size double bed, smart TV Set and private bathroom with shower.\n A large common bathroom with shower at the ground floor.\nUpper Floor\n A second bedroom with a queen-size double bed, smart TV set.\n A third bedroom with two twin push together single beds\n A fourth bedroom with bunk beds\n A large bathroom with shower\n Smart large TV at the living room.\n Air-conditioning in all areas.\n Free WiFi internet access.\n Outdoor dining set (table with chairs).\n Washing machine and dryer\n Iron and ironing board.\n Safe deposit box.\n Hair dryer.\n Linen and towels.\n Toiletries.\n Swimming pool towels.\n Baby cot.\n High chair for children.\n Housekeeping, towels and bed linen changed and cleaned every 3 or 4 days.\n Private parking area.\n Direct access to the swimming pool area.\n Private Heated Swimming pool with children/jacuzzi section.\n Swimming Pool cleaning twice per week\n Sun lounge area with sun beds and umbrellas.\n BBQ next to the swimming pool.', '2023-07-23 23:00:00', '2023-12-23 23:00:00', '2025-01-24', '18', 'Month', '200000', 200000, '1500', 1, 15, 'invest/3qwY3sGJIfbW3cNCLf9uXJudSv6z9lDSnTMe3wzQ.jpg', 'project', '830c467b-07bc-4fd7-87e7-830243fadd4f', NULL, 'percent', NULL, '1', '  Chania, Greece', 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, NULL, NULL, NULL, 0, 0, '21ecb553-6d87-44a7-9665-87dcec166315', '21ecb553-6d87-44a7-9665-87dcec166315', '2023-07-23 22:37:21', '2023-07-23 22:37:21', NULL),
('33fed47a-3b37-4a2b-b65a-b922179559b2', 'Amonde Village', 'amonde-village', 'comfort. 15min from Viana do Castelo, 35min. from Porto and 40min. from Vigo (ES).\nInserted in a family and welcoming environment, with unique locations.\nFree access to the Pool, Gym and Jacuzzi - for the exclusive use, for the period of 2 hours, for reservations longer than two nights, for each house, during the stay, with prior appointment and availability.\nEnjoy and come try it.\nThe space\nAmonde Village ***** consisting of two T2 houses, both with capacity for 4 people and a T1 with capacity for 3 people, fully equipped and independent...\nRelax in the middle of nature, with the highest quality and comfort. 15min from Viana do Castelo, 35min. from Porto and 40min. from Vigo (ES).\nInserted in a family and welcoming environment, with unique and stunning locations. Free access to the Pool, Gym and Jacuzzi - for the exclusive use, for the period of 2 hours, for reservations longer than two nights, for each house, during the stay, with prior appointment and availability.\nEnjoy and come try', '2023-07-23 23:00:00', '2023-12-23 23:00:00', '2025-01-24', '18', 'Month', '199995', 200000, '1000', 1, 12, 'invest/zjYEaQeQij1lG7SHvtlr4FO9851DlkBOl0TPMzzI.jpg', 'project', '830c467b-07bc-4fd7-87e7-830243fadd4f', NULL, 'percent', NULL, '1', 'Viana do Castelo, Viana do Castelo District, Portugal', 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, NULL, NULL, NULL, 0, 0, '21ecb553-6d87-44a7-9665-87dcec166315', '21ecb553-6d87-44a7-9665-87dcec166315', '2023-07-23 22:44:30', '2023-07-25 08:29:18', NULL),
('4560984e-523c-4743-a5f0-8e65312f4f17', 'Meristem Equity Market Fund', 'meristem-equity-market-fund', 'This is a pooled fund invested in listed shares on the Nigerian Stock Exchange. The fund is actively managed by professionals to generate returns for investors through capital appreciation and dividend income distribution.', NULL, NULL, NULL, NULL, 'Month', '10000000', 10000000, NULL, 1, NULL, 'invest/9f4oiWPg1GkukFzwi1VGb5mcxby6icKI8oTCJ0Mt.png', 'mutual', NULL, NULL, 'percent', NULL, '1', NULL, NULL, 'The Fund is aimed at investors who have a long-term investment perspective. The Fund is suited for more adventurous investors with a higher than average risk appetite.', 'The returns are based on daily changes in the price of the stocks. However, there can be losses.', 'This fund is provided by Meristem Wealth Management Limited. However, all transactions are aggregated by Kingsmen. As such, you can only redeem purchased units of this mutual fund directly through Kingsmen.', 'Vetiva Trustees', 'Standard Chartered', NULL, 0, 18, 1, 10, 10, 1, 0, 0, '21ecb553-6d87-44a7-9665-87dcec166315', '21ecb553-6d87-44a7-9665-87dcec166315', '2023-07-30 13:59:36', '2023-08-21 16:02:48', NULL),
('5641c03f-1bd7-4c6d-a1de-6b67e25f3b5a', 'TZ Farms', 'tz-farms', 'Psaltry International Company Limited (PIL) [https://psaltryinternational.com] is an agro-allied company founded by Oluyemisi Iranloye in the year 2005. The company started out by creating a market niche for cassava produce across the rural areas of Oyo State Nigeria. PIL initiated an out-grower program in September 2012 for farmers within an 80km radius of its factory before erecting a starch factory which commenced production in May 2013.\n\nPsaltry has over 8000 hectares of land suited for out-grower programs, and has employed more than 300 staff with an asset worth of 15 million USD. Our modus operandi is eco-friendly; We installed a water recycling system to detoxify recalcitrant substances before disposing them into the environment and reduces amount of water usage in our production process.\n\nCassava farming is a source of livelihood for millions of farmers. Also, cassava serves as a primary staple food to over 800 million people worldwide. It is the third-largest source of food carbohydrates in the tropics, after rice and maize. Cassava is used for producing food products like garri, flour, tapioca, fufu, chips, e.t.c. It is rich in vitamins, carbs, calcium, etc. Nigeria is the worlds largest producer of cassava, while Thailand is the largest exporter of cassava with most of it going to Europe. In 2017, Nigeria produced 59 million tons making about 20% of global world production. Besides, it exports about 3.2 million tons annually and earned $136 million in 2013.', '2023-07-23 23:00:00', '2023-12-23 23:00:00', '2024-11-24', '16', 'Month', '298043', 300000, '700', 1, 15, 'invest/AOecWkJ12Uj2PRZYClJXIzdp0Lk2wRZWpSjGl7JF.jpg', 'project', '840c467b-07bc-4fd7-87e7-830243fadd4f', NULL, 'percent', NULL, '1', 'Ibeju Lekki', 0, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, NULL, NULL, NULL, 0, 0, '21ecb553-6d87-44a7-9665-87dcec166315', '21ecb553-6d87-44a7-9665-87dcec166315', '2023-07-23 22:57:36', '2023-07-30 13:00:57', NULL),
('7eff90fc-a3d1-41aa-90e4-898e2671f37f', 'Cycladic homes', 'cycladic-homes', 'Blu studios are conveniently situated on a hill side, overlooking Milos bay, 5 minute drive from it. Six completely new studios, with queen beds, showers and adjoining W.C.s, built in the traditional island style. Air-conditioned, equipped with kitchenettes, T.V. sets, hair dryers and espresso coffee makers .They are ideal for couples. Individual verandas, wonderful view, big 130 sq. meters pool, peace and quiet, away from public roads, easy access to the island\'s fantastic beaches.\nThe space\nBlu 5 is a 44 sq.m suite which includes a queen bed plus an identical single armchair bed aside that can conveniently accommodate 3 adults. Spacious showers and adjoining W.C.s, built in the traditional island style are included. It is air-conditioned, equipped with kitchenette, refrigerator, flat screen tv, safe box, super soft luxury linen, hair dryers and espresso and French coffee makers. Hi-speed wi-fi free of charge is also available. Individual veranda with relaxing summer furniture with a wonderful view of Milos Bay with direct access to a 130 sq. meters pool with hydromassage and personal sunbeds. Blu studios\' visitors enjoy peace and quietness, away from public roads. An ample and super convenient parking space exists next to the room. The facility in total has easy access to most of the island\'s majestic beaches.', '2023-07-23 23:00:00', '2023-12-23 23:00:00', '2024-07-24', '12', 'Month', '200000', 200000, '1000', 1, 15, 'invest/TF8tlBTa62jviTepyzM7LLRUPJDK92Wffgj0sPDG.jpg', 'project', '830c467b-07bc-4fd7-87e7-830243fadd4f', NULL, 'percent', '', '1', 'Adamantas, Greece', 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, NULL, NULL, NULL, 0, 0, '21ecb553-6d87-44a7-9665-87dcec166315', '21ecb553-6d87-44a7-9665-87dcec166315', '2023-07-23 22:30:47', '2023-07-23 22:30:47', NULL),
('924a86b0-00f8-4294-aafb-960e8b068fc3', 'ARM Ethical Fund', 'arm-ethical-fund', 'The ARM Ethical Fund is an open-ended fund designed to enable investors acquire holdings in line with ethical Islamic investment principles.', NULL, NULL, NULL, NULL, 'Month', NULL, NULL, NULL, 1, NULL, 'invest/XpUoe3K4BA3zBTau0pl5gIazWQ8D6Nv5osMbUwe4.jpg', 'mutual', NULL, NULL, 'percent', NULL, '2', NULL, NULL, 'The Fund is suitable for investors who wish to achieve long-term capital growth on their investments and who have a high investment risk appetite', 'The returns are based on daily changes in the price of the stocks. However, there can be losses.', 'This fund is provided by ARM Investment Managers Limited. However, all transactions are aggregated by Kingsmen. As such, you can only redeem purchased units of this mutual fund directly through Kingsmen.\n', 'Royal Exchange Plc', 'Apex Ltd', 'https://google.com', 1, NULL, 0, 10, 10, 1, 0, 0, '21ecb553-6d87-44a7-9665-87dcec166315', '21ecb553-6d87-44a7-9665-87dcec166315', '2023-07-27 19:06:24', '2023-07-30 15:10:24', NULL),
('9ffa713e-70de-49b5-a233-9efb66c377d4', 'Le Quartz', 'le-quartz', 'QUARTZ, a high-end micro-hosting located in the heart of the boreal forest. Live the immersive experience of nature just 25 minutes from Old Quebec. Enjoy panoramic views of the surrounding mountains as well as breathtaking sunrises at the highest peak of Lac-Beauport. Discover the unique topography of the mountain by exploring the approximately 20km of trails accessible in any season.\nThe space\nMinimalist design, clean lines and maximum windows, this tiny house fits into its environment giving way to the spectacle of nature. Like the ore that makes up the characteristic rocky outcrops of Mont-Tourbillon, QUARTZ clings to the mountainside and offers you a breathtaking panorama.\nOther things to note\nWINTER ACCESS: From November 1 to April 15, an all-wheel drive (awd) or 4x4 car will be required to access the chalet.\n\nMovements between the 2 floors are made by a ladder located inside the micro-house or by the staircase located outside.', '2023-07-24 23:00:00', '2023-12-23 23:00:00', '2025-01-25', '18', 'Month', '400000', 400000, '2000', 1, 20, 'invest/y6DQAKC2PMDKHM9v7XSp1VwRYBxp0RBNtmyIUOoy.jpg', 'project', '830c467b-07bc-4fd7-87e7-830243fadd4f', NULL, 'percent', NULL, '1', 'Lac-Beauport, Quebec, Canada', 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, NULL, NULL, NULL, 0, 0, '21ecb553-6d87-44a7-9665-87dcec166315', '21ecb553-6d87-44a7-9665-87dcec166315', '2023-07-23 22:51:12', '2023-07-23 22:51:12', NULL),
('cc97fe41-f52c-4f24-8fe3-d7cef4e6f5e5', 'Cattle Herder Stock Program Investment', 'cattle-herder-stock-program-investment', 'Psaltry International Company Limited (PIL) [https://psaltryinternational.com] is an agro-allied company founded by Oluyemisi Iranloye in the year 2005. The company started out by creating a market niche for cassava produce across the rural areas of Oyo State Nigeria. PIL initiated an out-grower program in September 2012 for farmers within an 80km radius of its factory before erecting a starch factory which commenced production in May 2013.\n\nPsaltry has over 8000 hectares of land suited for out-grower programs, and has employed more than 300 staff with an asset worth of 15 million USD. Our modus operandi is eco-friendly; We installed a water recycling system to detoxify recalcitrant substances before disposing them into the environment and reduces amount of water usage in our production process.\n\nCassava farming is a source of livelihood for millions of farmers. Also, cassava serves as a primary staple food to over 800 million people worldwide. It is the third-largest source of food carbohydrates in the tropics, after rice and maize. Cassava is used for producing food products like garri, flour, tapioca, fufu, chips, e.t.c. It is rich in vitamins, carbs, calcium, etc. Nigeria is the worlds largest producer of cassava, while Thailand is the largest exporter of cassava with most of it going to Europe. In 2017, Nigeria produced 59 million tons making about 20% of global world production. Besides, it exports about 3.2 million tons annually and earned $136 million in 2013.', '2023-07-22 23:00:00', '2024-12-22 23:00:00', '2025-01-23', '18', 'Month', '50000', 50000, '200', 1, 10, 'invest/92cGqnkMr3w7S5jxccsOHTZbsANekydiMKT4amww.jpg', 'project', '840c467b-07bc-4fd7-87e7-830243fadd4f', NULL, 'percent', NULL, '1.5', 'Ibeju Lekki', 0, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, NULL, NULL, NULL, 0, 0, '21ecb553-6d87-44a7-9665-87dcec166315', '21ecb553-6d87-44a7-9665-87dcec166315', '2023-07-23 20:56:47', '2023-07-23 20:56:47', NULL);
