('f2807c36-a7ac-4671-9a47-eff620c8281f', 'cc97fe41-f52c-4f24-8fe3-d7cef4e6f5e5', 'Processing facility', 'Once cattle reach market weight (typically 1,200 to 1,400 pounds at 18 to 22 months of age), they are sent to a packing plant (also called a processing facility). \nUnited States Department of Agriculture (USDA) inspectors oversee the implementation of safety, animal welfare and quality standards from the time animals enter the plant until the final beef products are shipped to grocery stores and restaurants. \n\n', 'PACKING PLANT', 3, '2023-07-24 08:06:50', '2023-07-24 08:13:54', NULL);
