('3', 'Best-In-Class Assets', 'All the investment options listed on Fintech, are carefully screened, managed by professional fund managers. All the diverse mutual funds registered with the SEC, with standard third-party custodian software', 'clone', '2021-02-01 04:08:52', '2023-08-03 07:06:36'),
('b986a103-ebd2-4b99-a4a4-b5f9093393ee', 'Regulatory Compliance', 'Fintech is a duly registered fund manager with the Securities and Exchange Commission (SEC) of Nigeria. All our activities are in full compliance with regulatory requirements to the ultimate protection of our clients.', 'clone', '2023-07-09 20:09:45', '2023-08-03 07:06:24'),
('be437d56-8adf-4e74-967f-9c394a5e2d41', 'Assets Custody', 'Our users financial assets are held with a licensed custodian, Zenith Nominees Limited, for safekeeping to prevent misappropriation, misuse, theft, and/or loss, and in accordance with applicable law.', 'clone', '2023-07-09 20:14:31', '2023-07-20 05:51:37'),
('cd0d8beb-90e5-4591-9313-584beb8a931a', 'Top-Notch Security', 'We use industry-standard encryption technology to protect user data. We also use two-factor authentication to verify all customer accounts, so you can be sure that your funds are safe and secure.', 'clone', '2023-07-09 20:15:41', '2023-07-20 05:51:22');
